        props.setGame(value);
        // props.selectGame(game);
        // props.setStart({start: true});
    };

    return (
        <>
            <div>
                <h1>GameMenu</h1>
                <label>SnakeGame{' '}<button value="snake" onClick={() => gameStart("snake")} >Start</button></label>
                <br/><label>2048{' '}<button value="2048" onClick={() => gameStart("2048")}>Start</button></label>
            </div>
        </>
    );
};

